ptionFull";s:102:"<p>Bedankt voor uw bestelling. Wij zorgen ervoor dat uw Jelly zo spoedig mogelijk wordt verzonden!</p>";}i:5;a:8:{s:5:"iPage";i:23;s:11:"iPageParent";i:0;s:5:"sName";s:3:"FAQ";s:7:"iStatus";i:1;s:9:"iPosition";i:0;s:5:"iType";i:0;s:13:"iSubpagesShow";i:2;s:16:"sDescriptionFull";s:1887:"<p class="description"><strong>Waaruit wordt de suiker gewonnen,die wordt gebruikt bij de productie van de HARIBO-producten?</strong></p>|n|<p class="description">De suiker, zoals wij deze tegenwoordig als alledaags levensmiddel kennen en zoals deze ook in de industriële productie wordt toegepast, wordt uit suikerbieten vervaardigd. Dat bieten een hoog suikergehalte hebben, ontdekte men pas in het midden van de 18e eeuw. En de industriële suikerwinning op grote schaal kwam pas na de eeuwwisseling langzaam op gang. Vanaf het midden van de 19e eeuw werd bietsuiker tenslotte in toenemende mate voor brede lagen van de bevolking een betaalbaar levensmiddel. De tot op dat moment uit het Oosten resp. overzees geïmporteerde ruwe suiker was daarentegen sinds zijn introductie in Europa (rond de eerste eeuwwisseling) een duur luxeproduct, dat alleen de adel en rijke burgers zich konden permitteren als specerij of medicijn. In de late Middeleeuwen was een kilo ruwe suiker nog net zoveel waard als 100 kilo tarwe.</p>|n|<p class="description"><strong>Biedt HARIBO fabrieksbezichtigingen aan?</strong></p>|n|<p class="description">Voor de productie van JELLY-producten gelden extreem hoge en internationaal gestandaardiseerde hygiëne- en kwaliteitsstandaarden. Deze zogenaamde „International Food Standard“ (IFS) dient ertoe, een uiterst hoge mate aan levensmiddelveiligheid voor de consumenten te garanderen. Dat betekent helaas echter ook, dat ter bescherming van de gehele productie- en vulprocessen geen groepen bezoekers door de fabriekshallen rondgeleid mogen worden. Wij vragen daarom alle JELLY-fans om begrip voor het feit dat wij in principe geen fabrieksbezichtigingen aanbieden. U vindt geen passend antwoord op uw vraag? Onze <a style="text-decoration: underline; cursor: pointer;" href="?klantenservice,22">klantenservice </a>staat altijd graag voor u klaar. </p>";}i:6;a:9:{s:5:"iPage";i:21;s:11:"iPageParent";i:0;s:5:"sName";s:4:"HOME";s:10:"sNameTitle";s:14:"Jelly Homepage";s:7:"iStatus";i:1;s:9:"iPosition";i:0;s:5:"iType";i:2;s:13:"iSubpagesShow";i:2;s:4:"sUrl";s:2:"./";}i:7;a:9:{s:5:"iPage";i:3;s:11:"iPageParent";i:0;s:5:"sName";s:10:"JELLY SALE";s:7:"iStatus";i:1;s:9:"iPosition";i:0;s:5:"iType";i:2;s:13:"iSubpagesShow";i:3;s:9:"iProducts";i:1;s:16:"sDescriptionFull";s:62:"<div class="subtitle">25% KORTING OP ALLE SALE ARTIKELEN</div>";}i:8;a:8:{s:5:"iPage";i:19;s:11:"iPageParent";i:0;s:5:"sName";s:12:"JELLY SHOWER";s:7:"iStatus";i:1;s:9:"iPosition";i:0;s:5:"iType";i:2;s:13:"iSubpagesShow";i:2;s:9:"iProducts";i:1;}i:9;a:8:{s:5:"iPage";i:22;s:11:"iPageParent";i:0;s:5:"sName";s:14:"KLANTENSERVICE";s:7:"iStatus";i:1;s:9:"iPosition";i:0;s:5:"iType";i:0;s:13:"iSubpagesShow";i:2;s:16:"sDescriptionFull";s:455:"<p class="description">Welkom bij de klantenservice pagina. Wij helpen u graag. Wij zijn dagelijks van 08.00 tot 22.00 telefonisch bereikbaar en mailen binnen 24 uur terug. Telefoonnummer: +123 456 789 Mail: ujellycompany@jelly.com Voor algemene Jelly vragen, check eerst de FAQ.</p>|n|<p>Spring direct naar:</p>|n|<p><a href="?faq,23">FAQ</a></p>|n|<p><a href="?betalen,24"> Betalen </a></p>|n|<p><a href="?versheidsgarantie,25">Versheidsgarantie</a></p>";}i:10;a:8:{s:5:"iPage";i:26;s:11:"iPageParent";i:0;s:5:"sName";s:13:"TRACK & TRACE";s:7:"iStatus";i:1;s:9:"iPosition";i:0;s:5:"iType";i:0;s:13:"iSubpagesShow";i:2;s:16:"sDescriptionFull";s:307:"<p class="description">Heeft u artikelen besteld en als bezorgdienst PostNL gekozen? Volg dan deze link om uw bestelling te volgen. Hiervoor dient u uw track &amp; trace code (beginnend met 3S) bij de hand te hebben. <a href="https://jouw.postnl.nl/#!/track-en-trace/zoeken">PostNL track &amp; trace</a></